export default {
	getVehicle: () => {
		let vehicle_id = PayoutCampaignForm.formData.vehicle_id;

		if(typeof(vehicle_id) != "undefined" && vehicle_id != ""){
			let vehicle_data = VehicleSelectionList.data;
			let vehicle = vehicle_data.filter(function(vehicle){
				return vehicle.value == vehicle_id
			})[0];
			return "ID- "+ vehicle_id + ", " + vehicle.label
		}
		else{
			return "";
		}
	},
	getCity: () => {
		let city_id = PayoutCampaignForm.formData.city_id;
		if(typeof(city_id) != "undefined" && city_id != ""){
			let city_data = GeoRegionsSelect.data;
			let city=  city_data.filter(function(city){
				return city.value == city_id
			})[0]
			return "ID- "+ city_id + ", " + city.label
		}
		else{
			return "";
		}
	},
	getStartDate: () =>{
		return PayoutCampaignForm.formData.campaign_start_date + " 00:00"
	},
	getEndDate: () =>{
		return  PayoutCampaignForm.formData.campaign_end_date.split("T")[0] + " 23:59"
	},
	getTripFare: () =>{
		let campaign = PayoutCampaignForm.formData.campaigns.trip_fare;
		let trip_fare_string =  campaign.active ? "Acitve for City Launch" : "NA"
		return trip_fare_string
	},
	getFixed: () =>{
		let campaign = PayoutCampaignForm.formData.campaigns.fixed_percent_commission;
		let cap_amount = typeof(campaign.cap_amount) == "undefined" ? "NA" : campaign.cap_amount 
		let fixed_commision_string =  campaign.active ? `COMMISSION: ${campaign.commission_fraction}%			 CAP_AMOUNT: ${cap_amount}` : "NA"
		return fixed_commision_string
	},
	getDryRunCamp: () =>{
		let campaign = PayoutCampaignForm.formData.campaigns.dryrun;
		let dry_run_string =  campaign.active ? `MIN_KM: ${campaign.min_kms} 			PER_KM_RATE: ${campaign.per_km_rate} RS			 INCV_KM_CAP: ${campaign.incv_km_cap}` : "NA"
		return dry_run_string
	},
	getLogin: () =>{
		let campaign = PayoutCampaignForm.formData.campaigns.login_incentive;
		let login =  campaign.active ? `AMOUNT: ${campaign.incentive_amount} RS` : "NA"
		return login
	},
	getTripBased: () =>{
		let campaign = PayoutCampaignForm.formData.campaigns.trip_based_incentive;
		let tripbased =  campaign.active ? `MISSED_ORDER: ${campaign.max_missed_order_count} 			ABRTG_COUNT: ${campaign.max_abrtg_count}` : "NA";
		return tripbased;
	}

}
